function Hello() {

    const [data, setData] = useState("");

    useEffect(() => {
        api.get("/hello")
            .then((res) => {
                setData(res.data);
            })
            .catch((error) => {
                console.error("Error fetching data: ", error);
            });

    })

    return (
        <div>
            <h1>Test</h1>
            <p>{data}</p>
        </div>
    );
}

export default Hello;
